import Navbar from './Navbar'

import { useState } from 'react';
import Raoutpage from './Raoutpage';



function App() {

  const [page,setpage]=useState(1)

  const handleButton = ()=>{
    setpage(page+1)
  }

  const [mode,setMode]=useState('Light')
  const [textclr,setTextclr]=useState('black')
  const [navbg,setNavbg]=useState('primary')
  const [pagebg,setPagebg]=useState('light')



const handleMode = ()=>{
  if (mode === 'Light') {
    setTextclr('white')
    setNavbg('#6d1b7b')
    setPagebg('dark')
    setMode('Dark')
  }
  else if (mode === 'Dark'){
    setTextclr('black')
    setNavbg('primary')
    setPagebg('light')
    setMode('Light')
  }
}


  return (
    <div>

      <Navbar mode={mode} textclr={textclr} navbg={navbg} handleMode={handleMode}/>

      <Raoutpage page={page} handleButton={handleButton} pagebg={pagebg} textclr={textclr} />

    </div>
  );
}

export default App;
